// Resume.js
import React from "react";
import "../styles/Resume.css";
import { FaDownload, FaFilePdf } from "react-icons/fa";

const Resume = () => {
  const handleDownload = () => {
    // This would be replaced with actual download logic
    console.log("Downloading resume...");
    // In a real implementation, you would link to your actual PDF file
  };

  return (
    <div className="resume">
      <div className="resume-container">
        <h1 className="resume-heading">My Resume</h1>
        <div className="resume-preview">
          <FaFilePdf className="pdf-icon" />
          <p>Jose_Chemmanoor_Resume.pdf</p>
        </div>
        <button className="download-btn" onClick={handleDownload}>
          <FaDownload className="download-icon" />
          Download Resume
        </button>
        <div className="resume-details">
          <h2>Skills Summary</h2>
          <ul>
            <li>Frontend: React, HTML5, CSS3, JavaScript, Tailwind CSS</li>
            <li>Backend: Node.js, Express, Python</li>
            <li>Mobile: React Native</li>
            <li>Database: Firebase, MongoDB</li>
            <li>Tools: Git, GitHub, VS Code, Figma</li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default Resume;
